    <div>
      <img src="/cooklogo.png" alt="COOK Meals Logo" style={{ maxWidth: '200px', height: 'auto', marginBottom: '20px' }} />
      <h1>Login</h1>
      <p>This is the login page.</p>
    </div>
  );
}

